import React from "react";
import { Link } from "react-router-dom";
import "./NavBar.css";

class NavBar extends React.Component {
    render() {
        return (
            <div id="navBarContainer">
                <div id="linksContainer">
                    <Link to="/" className={`${ this.props.location.pathname == "/" ? "active" : ""} navBarLink`} onClick={() => this.setLinkActive(0)}>Home</Link>
                    <Link to="/projects" className={`${ this.props.location.pathname == "/projects" ? "active" : ""} navBarLink`} onClick={() => this.setLinkActive(1)}>Projects</Link>
                </div>
            </div>
        );
    }
}

export default NavBar;
